import input from "../../component/input"

const Form = () =>{
    return (
        <div className="bg-white w-[600px] h-[700px] shadow-lg rounded-lg flex flex-col justify-center items-center">
            <div className="text-4xl font-extrabold">Welcome</div>
            <div className="text-xl font-light">Sign up now to get started</div>
            <input label="Full Name" name="name" placeholder="Enter Your Full name"/>
            <input label="Email address" name="email" placeholder="Enter Your Email"/>
            <input label="Password" name="password" placeholder="Enter Your Password"/>

        </div>
    )
}
export default Form
